//Busca los datos del usuario
function BuscarEdoCdUser(email) {
  db.collection("reg_prop_prin_web")
    .where("email", "==", email)
    .get()
    .then(function (querySnapshot) {
      querySnapshot.forEach(function (doc) {
        if (querySnapshot._snapshot.docChanges.length != 0) {
          estado_global = doc.data().estado;
          ciudad_global = doc.data().ciudad;
          nombre_global = doc.data().nombre;
          apellido_global = doc.data().apellido;
        }
      });
    })
    .catch(function (error) {
      console.log(error);
    });
}

//Numero de cuenta y banco
function CuentaBanco() {
  db.collection("datos_banco")
    .get()
    .then(function (querySnapshot) {
      querySnapshot.forEach(function (doc) {
        if (querySnapshot._snapshot.docChanges.length != 0) {
          banco_global = doc.data().nombre_banco;
          numero_cuenta_global = doc.data().numero_cuenta;
        }
      });
    })
    .catch(function (error) {
      console.log(error);
    });
}

//Obtener Fecha Actual
function FechaActual() {
  let date = new Date();
  let mes = date.getMonth() + 1;
  let anio = date.getFullYear();
  let dia = date.getDate();

  if (mes < 10) {
    mes = "0" + mes;
  }
  if (dia < 10) {
    dia = "0" + dia;
  }

  fec_actual_global = dia + "/" + mes + "/" + anio;
}

//Obtener la cadena y dividir
function ObtenerCadena() {
  let arrayCadena = [];
  let contador = 0;
  let montoNumero = 0;
  let solicitudes = document.getElementById("cajaTaxiSelect").value;
  let tabla_taxi = document.getElementById("contenido_tabla_taxi");
  let encabezado_tabla = document.getElementById("tabla_taxi_encabezado");

  encabezado_tabla.innerHTML = "";
  encabezado_tabla.innerHTML = `
                <tr>
                    <th>Numero</th>
                    <th>Placa</th>
                    <th>Marca</th>
                    <th>Monto</th>
                </tr>`;
  FechaActual(); //Se ejecuta para obtener fecha
  tabla_taxi.innerHTML = "";
  if (solicitudes != "") {
    arrayCadena = DividirCadena(solicitudes);
    for (const iterator of arrayCadena) {
      contador += 1;
      montoNumero = parseInt(iterator.monto);
      monto_total_global += montoNumero;
      tabla_taxi.innerHTML += `
                <tr>
                    <td>${contador}</td>
                    <td>${iterator.placa}</td>
                    <td>${iterator.marca}</td>
                    <td>$${iterator.monto}</td>
                </tr>
            `;
    }
    //Agregamos el monto
    tabla_taxi.innerHTML += `
                <tr>
                    <td></td>
                    <td></td>
                    <td></td>
                    <td></td>
                </tr>
                <tr>
                    <td></td>
                    <td></td>
                    <td><h5>TOTAL: </h5></td>
                    <td class="font-weight-bold">$${monto_total_global}</td>
                </tr>
            `;

    generate();
  } else {
    console.log("nada");
  }
}

//Dividir cadena
function DividirCadena(cadena) {
  //Se eliminar las comas
  let filtroUnoComa = [];
  let filtroUnoComa2 = [];
  let usuario = {};
  filtroUnoComa = cadena.split(",");
  for (let i = 0; i < filtroUnoComa.length; i++) {
    usuario = { usuario: filtroUnoComa[i] };
    filtroUnoComa2.push(usuario);
  }
  //Se eliminan los signos igual
  let filtroDosIgual = [];
  let usuario2 = {};
  for (let i = 0; i < filtroUnoComa2.length; i++) {
    usuario2 = { usuario2: filtroUnoComa2[i].usuario.split("=") };
    filtroDosIgual.push(usuario2);
  }
  //Se eliminan los guiones bajos
  let filtroTresGuion = [];
  let usuario3 = {};
  for (let i = 0; i < filtroDosIgual.length; i++) {
    usuario3 = {
      usuario: filtroDosIgual[i].usuario2[0].split("_"),
      id: filtroDosIgual[i].usuario2[1],
    };
    filtroTresGuion.push(usuario3);
  }
  //Se eliminan los signos >
  let filtroCuatroMayor = [];
  let usuario4 = {};
  for (let i = 0; i < filtroTresGuion.length; i++) {
    usuario4 = {
      placa: filtroTresGuion[i].usuario[0],
      monto: filtroTresGuion[i].usuario[1],
      id: filtroTresGuion[i].id.split(">"),
    };
    filtroCuatroMayor.push(usuario4);
  }
  //Resultado final acomodando los objetos
  let resultadoFinal = [];
  let objetosFinales = {};
  for (let i = 0; i < filtroCuatroMayor.length; i++) {
    objetosFinales = {
      id: filtroCuatroMayor[i].id[0],
      marca: filtroCuatroMayor[i].id[1],
      placa: filtroCuatroMayor[i].placa,
      monto: filtroCuatroMayor[i].monto,
    };
    resultadoFinal.push(objetosFinales);
  }
  //console.log(resultadoFinal);
  return resultadoFinal;
}

//Metodo para genera el PDF
function generate() {
  var doc = new jsPDF("p", "pt", "a4");
  var source = document.getElementById("pago_taxis").innerHTML;

  var imgData =
    "data:image/jpeg;base64,";

  //Imagen Logo
  doc.addImage(imgData, "JPEG", 80, 80, 100, 100, "alias");

  //Titulo documento
  doc.setFontSize(15);
  doc.setFontStyle("bold");
  doc.text("PAGO DE MENSUALIDAD TAK-SI.", 200, 109);

  //Tama√±o, Color de texto
  doc.setFontSize(12);
  doc.setTextColor(75, 72, 72);

  //Lugar
  doc.setFontStyle("bold");
  doc.text("Lugar:", 200, 129);
  doc.setFontStyle("normal");
  doc.text(ciudad_global + ", " + estado_global, 249, 129);

  //Nombre usuario
  doc.setFontStyle("bold");
  doc.text("Nombre:", 200, 144);
  doc.setFontStyle("normal");
  doc.text(nombre_global + " " + apellido_global, 258, 144);

  //Fecha Actual
  doc.setFontStyle("bold");
  doc.text("Fecha: ", 200, 159);
  doc.setFontStyle("normal");
  doc.text(fec_actual_global, 250, 159);

  //Numero de cuenta
  doc.setFontSize(14);
  doc.setTextColor(75, 72, 72);
  doc.setFontStyle("bold");
  doc.text("NUMERO DE CUENTA:", 80, 209);
  doc.setFontStyle("normal");
  doc.text("" + numero_cuenta_global + "", 242, 209);

  //BANCO
  doc.setFontStyle("bold");
  doc.text("BANCO:", 80, 229);
  doc.setFontStyle("normal");
  doc.text(banco_global, 145, 229);

  //TOTAL A PAGAR
  doc.setFontStyle("bold");
  doc.text("TOTAL A PAGAR:", 80, 249);
  doc.setFontStyle("normal");
  doc.text("$ " + monto_total_global + " Pesos", 208, 249);

  //Taxis seleccionados
  doc.setFontSize(15); //tama√±o letra
  doc.setFontStyle("bold"); //estilo letra
  doc.text("TAXIS SELECCIONADOS.", 80, 299); //direccion letra

  //Nota
  doc.setFontSize(9);
  doc.setTextColor(75, 72, 72);
  doc.setFontStyle("bold");
  doc.text("NOTA:", 80, 329);
  doc.setFontStyle("normal");
  doc.text(
    "DESPUES DE PAGAR, ESCANEE SU TICKET DE PAGO, DIRIJASE A SU CUENTA TAK-SI",
    112,
    329
  );
  doc.setFontStyle("normal");
  doc.text(
    "EN EL APARTADO 'VER PAGOS' PODR√Å SUBIR LA IMAGEN ESCANEADA DE SU TICKET DE PAGO",
    80,
    344
  );

  var margins = {
    top: 359,
    bottom: 10,
    left: 80,
    width: 595,
  };

  doc.fromHTML(
    source, // HTML string or DOM elem ref.
    margins.left,
    margins.top,
    {
      width: margins.width,
      elementHandlers: specialElementHandlers,
    },

    function (dispose) {
      // dispose: object with X, Y of the last line add to the PDF
      //          this allow the insertion of new lines after html
      doc.save("FormatoPago.pdf");
    },
    margins
  );
}

//Se usa para generar pdf
var specialElementHandlers = {
  // element with id of "bypass" - jQuery style selector
  ".no-export": function (element, renderer) {
    // true = "handled elsewhere, bypass text extraction"
    return true;
  },
};

//Evento click para generar pdf
$("#btn_desc_pdf_pago").click(function (e) {
  e.preventDefault();
  ObtenerCadena();
});
